INSERT INTO `wp_posts` VALUES (93,1,'2024-06-15 15:05:35','2024-06-15 21:05:35','Gabby\'s movement coaching service focuses on helping individuals improve their mobility and overall physical well-being. With a tailored approach, she addresses specific needs and goals, whether you\'re looking to enhance your athletic performance or simply move with greater ease. Gabby combines her expertise in movement techniques with personalized coaching to ensure each session is effective and enjoyable.','Movement Coaching Session','','publish','closed','closed','','movement-coaching-session','','','2024-06-15 23:05:07','2024-06-16 05:05:07','',0,'http://vandril-coaching.local/?post_type=services&#038;p=93',0,'services','',0);
INSERT INTO `wp_posts` VALUES (94,1,'2024-06-15 16:34:30','2024-06-15 22:34:30','<div class=\"flex flex-grow flex-col max-w-full\">\r\n<div class=\"min-h-[20px] text-message flex flex-col items-start whitespace-pre-wrap break-words [.text-message+&amp;]:mt-5 juice:w-full juice:items-end overflow-x-auto gap-2\" dir=\"auto\" data-message-author-role=\"assistant\" data-message-id=\"4cd9e4dc-24ca-4b38-b6c0-033762ab7915\">\r\n<div class=\"flex w-full flex-col gap-1 juice:empty:hidden juice:first:pt-[3px]\">\r\n<div class=\"markdown prose w-full break-words dark:prose-invert light\">\r\n\r\nGabby\'s strength coaching service is designed to help individuals build muscle, increase strength, and enhance overall physical performance. She creates customized workout plans that cater to each person\'s fitness level and goals. With a focus on proper form and technique, Gabby ensures that clients gain strength safely and effectively, empowering them to reach their full potential.\r\n\r\n</div>\r\n</div>\r\n</div>\r\n</div>','Strength Coaching','','publish','closed','closed','','violin-mobility-coaching','','','2024-06-15 23:07:17','2024-06-16 05:07:17','',0,'http://vandril-coaching.local/?post_type=services&#038;p=94',0,'services','',0);
